def read_data_snli(data_dir, is_train, is_dev):
    data_dir = os.path.join(data_dir, 'original','raw')
    file_name = os.path.join(data_dir, 'in_domain_dev.tsv' if is_dev else 'in_domain_test.tsv')
    file_name = os.path.join(data_dir, 'in_domain_train.tsv' if is_train else 'in_domain_test.tsv')
    with open(file_name, 'r') as f:
      lines = [line.split('\t') for line in f.readlines()]
    def extract_text(s):
        s = re.sub('.\n','',s)
        s = re.sub(',','',s)
        return s
    tokens = [extract_text(line[-1]) for line in lines]
    labels = [line[1] for line in lines]
    return tokens, labels

