# Assuming DatasetforQuestionAnswering is defined elsewhere

class BertForQuestionAnswering(BertPreTrainedModel):
    def __init__(self, config):
        super().__init__(config)
        self.bert = BertModel(config)
        self.qa_outputs = nn.Linear(config.hidden_size, 2)

        self.init_weights()

    def forward(
        self,
        input_ids=None,
        attention_mask=None,
        token_type_ids=None,
        position_ids=None,
        head_mask=None,
        inputs_embeds=None,
        start_positions=None,
        end_positions=None,
    ):
        outputs = self.bert(
            input_ids,
            attention_mask=attention_mask,
            token_type_ids=token_type_ids,
            position_ids=position_ids,
            head_mask=head_mask,
            inputs_embeds=inputs_embeds,
        )

        sequence_output = outputs[0]

        logits = self.qa_outputs(sequence_output)
        start_logits, end_logits = logits.split(1, dim=-1)
        start_logits = start_logits.squeeze(-1)
        end_logits = end_logits.squeeze(-1)

        outputs = (start_logits, end_logits) + outputs[2:]

        if start_positions is not None and end_positions is not None:
                    # Ensure start_positions and end_positions are on the same device as logits
                    start_positions = start_positions.to(start_logits.device)
                    end_positions = end_positions.to(end_logits.device)

                    # Clamp start_positions and end_positions to be within the valid range
                    start_positions = start_positions.clamp(0, start_logits.shape[1] - 1)
                    end_positions = end_positions.clamp(0, end_logits.shape[1] - 1)

                    loss_fct = nn.CrossEntropyLoss()
                    start_loss = loss_fct(start_logits, start_positions)
                    end_loss = loss_fct(end_logits, end_positions)
                    total_loss = (start_loss + end_loss) / 2
                    outputs = (total_loss,) + outputs

        return outputs

def train_loop(model, df_train, df_val):
    train_dataset = DatasetforQuestionAnswering(df_train)
    val_dataset = DatasetforQuestionAnswering(df_val)

