            optimizer.zero_grad()
            # passing token_type_ids to the model
            outputs = model(input_id, attention_mask=mask, token_type_ids=token_type_ids, start_positions=start_positions, end_positions=end_positions)
            loss = outputs[0]  # total_loss
            start_logits, end_logits = outputs[1], outputs[2]

            total_loss_train += loss.item()

            start_preds = start_logits.argmax(dim=1)
